import styled from '@emotion/styled';

export const FriendsList = styled.ul`
  display: flex;
  flex-direction: column;
  align-items: center;
  vertical-align: middle;
  margin: auto;
  font-size: 28px;
  font-weight: 500;
  width: 80%;
`;
